import React from "react";
import ContentBox from './ContentBox.js';
import './Boxes.css'

function Boxes() {

    const repositories = [
      {boxName: "DocHub", boxUrl: "https://github.hpe.com/denisse-ugalde/DocHub"}, 
      {boxName: "PVSDK", boxUrl: "https://github.hpe.com/denisse-ugalde/DocHub"},
      {boxName: "OTHERS", boxUrl: "https://github.hpe.com/denisse-ugalde/DocHub"},
      {boxName: "PVSDK", boxUrl: "https://github.hpe.com/denisse-ugalde/DocHub"},
      {boxName: "OTHERS", boxUrl: "https://github.hpe.com/denisse-ugalde/DocHub"},
    ];

    return (
      <div className="boxes_containers">
        <div className="box-container"> {/*'You can access the link to different repos here'*/}
          {repositories.map(box => (
            <ContentBox key={box.boxName} repoName={box.boxName} repoUrl={box.boxUrl} />
          ))}
        </div>
      </div>
    );
  }

export default Boxes;
